window.bookSummaryJSON = "<p>Pirates and slavers beware. The Spacemage is coming for you!</p> <p>All Thorn wanted was to be a Battle Mage. He had the talent, and his whole future was before him. On the day of Choosing, he finds things don't always go as planned. Suddenly Thorn's life is thrown into fast forward, and he finds himself in a world not of his own choosing.</p> <p>In a world of spaceships and blasters, instead of horses and swords, Thorn needs to adapt and survive, make new allies, and rediscover that although nothing is familiar, he's still a Mage, and pirates and slavers beware.</p> <p>Yesterday is history, and today he's become <i>Yesterday's Spacemage</i>.</p>"; 
